import React from "react";
import Entry from "./Entry"
import emojipedia from '../emojipedia';
function App() 
{
  function createEntry(emo)
  {
     return(
       <div>
         <Entry key={emojipedia.id} emoji={emojipedia.emoji} name={emojipedia.name} 
           mean={emojipedia.meaning}
         />
       </div>
     )
  }
  return (
    <div>
      <h1>
        <span>emojipedia</span>
        {Map.emojipedia(createEntry)}
      </h1>


    </div>
  );
}

export default App;
